import { Card, CardBody, CardTitle, CardSubtitle, CardText, Button, CardImg } from "reactstrap";
const cardInfo = (props) => {
  return (
    <Card>
      <CardImg
        alt="Card image cap"
        src={props.photos_sample[0].large_photo_url}
        top
        width="50%"
      />
      <CardBody>
        <CardTitle tag="h5">
          {props.name}
        </CardTitle>
        <CardSubtitle
          className="mb-2 text-muted"
          tag="h6"
        >
          {props.subtypes}
        </CardSubtitle>
        <CardText>
          Phone Number:{props.phone_number}<br/>
          Address:{props.full_address}
          Rate:{props.rating}
        </CardText>
        <Button primary>
          Button
        </Button>
      </CardBody>
    </Card>
  )
}
export default cardInfo
